import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <header className="header">
      <div className="logo">Truelive.ai</div>
      <nav>
        <ul>
          <li>Home</li>
          <li>Pages</li>
          <li>Blog</li>
          <li>Contact</li>
        </ul>
      </nav>
      <button className="login-btn">Register / Login</button>
    </header>
  );
};

export default Header;
